import React from "react";
import Chip from "@material-ui/core/Chip";
import withStyles from "@material-ui/core/styles/withStyles";
import PropTypes from "prop-types";
import { styles } from "./styles";

const CustomTag = ({ classes, icon, label, color, className }) => {
    const labelClass = icon ? classes.hasIconLabel : classes.label;

    return (
        <Chip
            classes={{
                root: classes.root,
                label: labelClass,
                icon: classes.icon,
            }}
            label={label}
            className={`
        ${classes[color]}
        ${icon ? classes.hasIcon : classes.noIcon}
        ${className && className}
        `}
            icon={icon}
        />
    );
};

CustomTag.propTypes = {
    classes: PropTypes.object.isRequired,
    icon: PropTypes.object,
    label: PropTypes.string,
    color: PropTypes.string,
    className: PropTypes.string,
};

export default withStyles(styles, { withTheme: true })(CustomTag);
